import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

function App() {
  return (
    <header>
      <div>
        <form>
          <input type={text} placeholder="sjjskj"></input>
        </form>
      </div>
    </header>
  );
}

ReactDOM.render(<App />, document.querySelector("#root"));
